const primary = styles.primary
const medium = styles.medium

const WishlistButton = ({ label, onClick }) => {
	
	return (
		<button
			className={`${medium} ${primary}`}
			onClick={onClick}
		>
			{label}
		</button>
	)
}

export default WishlistButton;
